import { BrowserRouter,Route,Routes } from 'react-router-dom';
import Prueba from './componentes/Prueba';
import Pruebados from './componentes/Pruebados';
import { useState } from 'react';
import './stilo.css'
function App() {
  const [inicio,setInicio]=useState("inicio_on")
  function quitar(){
    setInicio("inicioo_off")
  }
  return (
    <BrowserRouter>
    <div className={inicio}>
      <a href='http://192.168.1.6:3000/p' onClick={quitar}>prueba</a>
      <a href='http://192.168.1.6:3000/c'>prueba dos</a>
    </div>
      <Routes>
      <Route path='/p' element={<Prueba/>}/>
      <Route path='/c' element={<Pruebados/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
